import React, { Component } from 'react';
import Axios from 'axios';

export default class App extends Component {
    constructor(){
        super();
        this.state = {
            indexData: []
        }
    }

    componentDidMount() {
        Axios.get('http://localhost:8080/').then(
            res => {
                this.setState({indexData:res.data});
            }
        ).catch(err => {
            console.log(err);
        });
    }

    render() {
        return (
            <div>
                <TableComp />
            </div>
        );
    }
}

const TableComp = () => {
    return (
        <table>
            <thead>
                <tr><th>ID</th>
                <th>name</th></tr>
            </thead>
            <tbody>
            {this.state.indexData.map(
                (res,index) => <tr key={index}><td>{res.id}</td><td>{res.name}</td></tr>
            )}
            </tbody>
        </table>
    );
}
